import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Post = () => {
  const [post, setPost] = useState(null);

  useEffect(() => {
    // Replace with the actual post ID you want to retrieve
    const postId = 123;

    axios.get(`https://public-api.wordpress.com/wp/v2/sites/joshuajong4.wordpress.com/posts/26`)
      .then((response) => {
        setPost(response.data);
      })
      .catch((error) => {
        console.error('Error:', error);
      });
  }, []);

  return (
    <div>
      {post ? (
        <div>
          <h2>{post.title.rendered}</h2>
          <div dangerouslySetInnerHTML={{ __html: post.content.rendered }} />
        </div>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
};

export default Post;
